INSERT INTO `question` (`id`, `question`, `answer`, `type`, `created`, `modified`) VALUES
(4, 'Do I need to pay agency fee to TuitionDB.com?', 'NO. It is absolutely FREE.', 1, NULL, '2014-07-25 03:00:28'),
(6, 'I’m interested in the teaching assignment, how can I apply for it?', 'Login as tutor and simply click on the “Apply” (at the right bottom of the assignment info), then your profile will be listed as “self-recommendation” tutor. The student will receive a notification about your application and will be able to view your profile.', 1, NULL, '2014-07-25 03:03:11'),
(7, 'How long does it take for me to find a tuition assignment?', 'This is much depends on your skills set and tutoring rate, based on our database, tutors who teach primary to JC subjects have higher chances to get the teaching assignments. ', 1, NULL, '2014-07-25 03:08:08'),
(8, 'Why I am not top rated tutor?', 'We rate our tutors based on their skills set and qualification which are matched to the subjects they are teaching. Tutors will have absolute higher rating if they gain good feedback from students.', 1, NULL, '2014-07-25 03:08:41'),
(9, 'What tuition rate should I apply for? ', 'Please refer to guideline of tuition rate on TuitionDB.com.', 1, NULL, '2014-07-25 03:09:45'),
(10, 'Should I apply for the assignments which were posted a few weeks ago?', 'Yes, you may do so as long as the assignment is still valid and open for application. ', 1, NULL, '2014-07-25 03:10:20'),
(12, 'If I found that the student is not suitable for me, Can I terminate the teaching agreement?', 'Yes. You may do so, but you are strongly advice not to do so. We believe all students are unique. As private tutors, please bear in mind that it is our top priority to access student’s knowledge level, learning ability and then help them to set and achieve the goals at different learning stages.', 1, NULL, '2014-07-25 03:15:44'),
(13, 'How to select a tutor?', 'It is your choice to choose the tutor. You may look at the education level, experience etc. Should you need our assistance, please do not hesitate to call us at 3150 5186.', 2, NULL, '2014-07-25 03:19:41'),
(14, 'Can I choose another tutor if I found the tutor is not suitable for me?', 'If you find the tutor is not suitable after first one or two lessons, just talk to us, we should be able to help you choose another one.', 2, NULL, '2014-07-25 03:20:21'),
(15, 'Is this a free service?', 'It is FREE for first 3 months from the date of registration. For the subsequent months, it will be charged at $50 per month. ', 3, NULL, '2014-12-20 22:56:55');
