INSERT INTO `tutorqualification` (`id`, `tutorId`, `tutoringMode`, `dictTutorQualificationId`, `dictTutorCredentialId`, `experienceStyle`, `created`, `modified`) VALUES
(2, 3, 1, 4, NULL, 'I have 11 years of teaching experience in both home and class tutoring. Give me a chance, I will bring out the best in you child!', '2014-07-03 03:16:18', '2014-07-03 03:16:18'),
(3, 4, 0, 5, NULL, '- I believe Education should be fun, learning experiences\r\n- I believe every students are different, so different approach of teaching style is needed.', '2014-07-03 03:36:29', '2014-07-03 03:36:29'),
(5, 6, 0, 3, NULL, 'I love teaching, no tutoring experience yet.', '2014-07-17 01:21:26', '2014-07-17 01:21:26'),
(6, 7, 0, 4, NULL, 'Ever taught several uni-student.mathematics, help him got a very good result in the final exam.', '2014-07-17 01:59:38', '2014-07-17 01:59:38'),
(7, 8, 0, 4, NULL, '- I have 2 years'' teaching experience while in university\r\n- I have taught 8 juniors on Maths and Physics\r\n- Most of my students scored A on the subject I taught\r\n- I am under MOE full scholarship', '2014-07-17 02:27:15', '2014-07-17 02:27:15'),
(8, 9, 0, 5, NULL, 'I have ever taught 5 uni-student electronics and mathematics for 6 months, most of them got B~A in the final exam. ', '2014-07-17 02:27:45', '2014-07-17 02:27:45'),
(9, 10, 0, 4, NULL, 'NA', '2014-07-18 17:08:14', '2014-07-18 17:08:14'),
(10, 11, 0, 4, NULL, 'Free style', '2014-07-20 07:25:38', '2014-07-20 07:25:38'),
(11, 12, 0, 6, 7, 'Temasek Polytechnic: 3 years full time\r\nITE: 2 years full time\r\nUniversity of Newcastle: 7 years part time\r\nEdith Cowan University: 4 years part time\r\nSIM University: 7 years part time\r\n\r\nBachelor Degree: Dean''s List, Compaq Asia Book Prize', '2014-07-25 03:57:22', '2014-07-25 03:57:22'),
(12, 13, 1, 5, 13, 'A part-time/freelance lecturer since 1994 in Singapore Poly, SIM and MDIS degree program, I am now a full-time mathematics tutor, Math Olympiad trainer, MOE registered instructor and PA approved trainer.\r\n\r\nMy strong area is in upper secondary (national exam) related topics. \r\n\r\nI aim to help the student appreciate the subject, understand the link connecting the various concepts, and hence develop their problem solving skills.\r\n', '2014-07-25 04:23:29', '2014-07-25 04:23:29'),
(13, 14, 1, 5, NULL, 'I am specialized in teaching mathematics for all levels students. ', '2014-07-25 05:01:43', '2014-07-25 05:01:43'),
(14, 15, 0, 5, NULL, 'Theories and pragmatic experiences give more integrated understanding of marketing and international business.', '2014-07-25 14:30:44', '2014-07-25 14:30:44'),
(15, 16, 0, 3, NULL, 'Math and Chinese.', '2014-07-25 14:37:38', '2014-07-25 14:37:38'),
(16, 17, 0, 5, NULL, 'Hello', '2014-07-25 15:16:17', '2014-07-25 15:16:17'),
(17, 18, 0, 1, NULL, 'NA', '2014-07-25 17:50:43', '2014-07-25 17:50:43'),
(18, 19, 0, 2, NULL, 'Part- time Mandarin teacher', '2014-07-28 08:55:10', '2014-07-28 08:55:10'),
(19, 20, 1, 4, NULL, 'abc\r\nabc', '2014-08-25 10:20:13', '2014-08-25 10:20:13'),
(20, 21, 0, 3, NULL, '            I am a Year1 student in NUS.\r\nhave taught a P5 student Mathematics and English for 6 months. After about 2months, he was in the top 100 in his school.\r\nan intern in a primary school before.\r\nhave been the mentor for the Mentorship Programme in Sembawang Family Service Centre.\r\nthe top 2% in Singapore for Secondary 2 Mathematics International Competition in 2009.\r\nObtained a scholarship from Sembawang Shipyard for my O''LEVEL\r\nTop 3 Student during secondary school\r\nScore A for PW', '2014-08-28 10:40:33', '2014-08-28 11:17:55'),
(21, 22, 0, 3, NULL, 'I specialise in languages, especially english.\r\nI have worked with students in small groups of 3 to 4 to help develop their basic reading and writing skills. I have also created lesson plans for all classes taught, including English, Grammar, and Vocabulary Development.\r\nCurrently, I am also taking up my Diploma in English to advance myself further in Languages.\r\nDo drop me a message for any enquiries to answer any questions you might have. I hope to hear from you. Have a good day!', '2014-12-19 12:39:02', '2014-12-19 12:39:02'),
(22, 23, 0, 5, 6, 'I am responsible and caring. ', '2014-12-21 03:37:37', '2014-12-21 03:37:37'),
(23, 24, 0, 3, NULL, 'I am experienced tutor for primary students.', '2014-12-21 04:26:09', '2014-12-21 04:26:09');
